// src/components/MapInfo.js
import React from 'react';

const PartyInfo = () => {
    return (
    <div>
        <h2>파티 만들기</h2>
        <p>파티 만들기 탭입니다. 여기에 위치 정보나 지도가 표시될 수 있습니다.</p>
    </div>
    );
};

export default PartyInfo;
